import React from "react";
import "./Authentication.css";
import Form from "../Form/Form";
import validations from "../../Validations/Validations";
export default function Authentication(props) {
  return (
    <div className="auth_container">
      <Form
        formLogo={
          <img
            className="authentication_logo"
            src="https://calcalistcareebiz.s3.eu-central-1.amazonaws.com/6288/2/6288636806425463443521_26.jpg"
          />
        }
        fields={{ email: "" }}
        elements={[
          {
            id: 1,
            type: "input",
            title: "First Name",
            placeholder: "first name",
            customClass: "first_name",
            validate: (v) => {
              return validations.first_name(v.toString().toLowerCase());
            },
          },

          {
            id: 2,
            type: "input",
            title: "Last Name",
            placeholder: "last name",
            customClass: "last_name",
            value: "",
            validate: (v) => {
              return validations.last_name(v.toString().toLowerCase());
            },
          },
          {
            id: 3,
            type: "input",
            title: "Email",
            placeholder: "Email",
            customClass: "email",
            validate: (v) => {
              return validations && validations.email
                ? validations.email.test(v.toString().toLowerCase())
                : false;
            },
          },
        ]}
      />
    </div>
  );
}
